import React from "react";

class ImageList extends React.Component {
  render() {
    return this.props.images.map((singleImg) => {
      return <ImageCard/> (
        <img
          alt={singleImg.description}
          
          src={singleImg.urls.regular}
        />
      );
    });
  }
}

export default ImageList;
